import styled from 'styled-components';

export const Navs = styled.nav`
	background: var(--bground);
	.nav-link {
		font-size: .85rem;
		color: var(--navGray);
		transition:    all 0.8s ease-in-out;
		font-weight: 600;
		padding: .75rem 1.25rem;
  		border-radius: 40px;
	}
	.nav-link:hover{
		color: var(--navHover);
	}
	.nav-active { 
  		background-color: var(--purple);
	}
`;
